Mongo aggregation framework match a given _id<p>My model :</p>
<pre><code>const scheduleTaskSchema = new Schema({
  activity: { type: Object, required: true },
  date: { type: Date, required: true },
  crew: Object,
  vehicle: Object,
  pickups: Array,
  details: String,
});
const ScheduleTaskModel =  mongoose.model(&quot;schedule_task&quot;, scheduleTaskSchema),
</code></pre>
<p>and this aggregation pipeline :</p>
<pre><code>  let aggregation = [
    {
      $sort: {
        &quot;pickups.0.time&quot;: 1,
      },
    },
    {
      $group: {
        _id: &quot;$date&quot;,
        tasks: { $push: &quot;$$ROOT&quot; },
      },
    },
    { $sort: { _id: -1 } },
  ];



  if (hasDateQuery) {
    aggregation.unshift({
      $match: {
        date: { $gte: new Date(start_date), $lte: new Date(end_date) },
      },
    });
  } else {
    aggregation.push({ $limit: 2 });
  }

  const scheduledTasksGroups = await ScheduleTaskModel.aggregate(aggregation);
</code></pre>
<p>the <code>crew</code> object can have arbitrary number of keys with this structure :</p>
<pre><code>crew : {
  drivers: [
    {
      _id: &quot;656b1e9cf5b894a4f2v643bc&quot;,
      name: &quot;john&quot;
    },
    {
      _id: &quot;567b1e9cf5b954a4f2c643bhh&quot;,
      name: &quot;bill&quot;
    }
  ],
  officers: [
    {
      _id: &quot;655b1e9cf5b6632a4f2c643jk&quot;,
      name: &quot;mark&quot;
    },
    {
      _id: &quot;876b1e9af5b664a4f2c234bb&quot;,
      name: &quot;jane&quot;
    }
  ],
  //...any number of keys that contain an array of objects that all have an _id
}
</code></pre>
<p>I'm looking for a way to return all documents (before sorting/grouping) that contain a given <code>_id</code> anywhere within the <code>crew</code> object without knowing which key to search,it can be many different keys that all contain an array of objects that all have an <code>_id</code></p>
<p>Any ideas ?</p>

