<p>My goal is to delete all instances whose owner id is equal to a certain value.</p>
<p>Here is my data sample</p>
<pre class="lang-json prettyprint-override"><code>[
  {
    &quot;id&quot;: 1,
    &quot;instances&quot;: [
      {
        &quot;id&quot;: 2,
        &quot;owner&quot;: {
          &quot;id&quot;: 2
        }
      }
    ]
  },
  {
    &quot;id&quot;: 2,
    &quot;instances&quot;: [
      {
        &quot;id&quot;: 1,
        &quot;owner&quot;: {
          &quot;id&quot;: 1
        }
      },
      {
        &quot;id&quot;: 4,
        &quot;owner&quot;: {
          &quot;id&quot;: 2
        }
      }
    ]
  },
  {
    &quot;id&quot;: 3,
    &quot;instances&quot;: [
      {
        &quot;id&quot;: 3,
        &quot;owner&quot;: {
          &quot;id&quot;: 1
        }
      }
    ]
  }
]
</code></pre>
<p>This is the operation I'm trying to execute</p>
<pre class="lang-js prettyprint-override"><code>db.collection.update({},
{
  &quot;$pull&quot;: {
    &quot;instances&quot;: {
      &quot;owner.id&quot;: 1
    }
  }
})
</code></pre>
<p>This version does not update anything.</p>
<p>ALTHOUGH, if I modify the filter to specify an id :</p>
<pre class="lang-js prettyprint-override"><code>db.collection.update({
  &quot;id&quot;: 2
