  &quot;$pull&quot;: {
    &quot;instances&quot;: {
      &quot;owner.id&quot;: 1
    }
  }
})
</code></pre>
<p>It works just fine on the document that has the id &quot;2&quot;. Why can't I specify an empty filter ?</p>
