<li>Original doc : <a href="https://www.mongodb.com/docs/manual/reference/operator/update/pull/#remove-items-from-an-array-of-documents" rel="nofollow noreferrer">https://www.mongodb.com/docs/manual/reference/operator/update/pull/#remove-items-from-an-array-of-documents</a></li>
