MongoDB: how to aggregate from multiple collections with same aggregation pipeline<p>I'm trying to get aggregations with same aggregation pipeline including <code>$match</code> and <code>$group</code> operations from multiple collections.</p>
<p>For example,</p>
<p>with a <code>users</code> collection and collections of <code>questions</code>, <code>answers</code> and <code>comments</code> where every document has <code>authorId</code> and <code>created_at</code> field,</p>
<pre><code>db = [
    'users': [{ _id: 123 }, { _id: 456} ],
    'questions': [
        { authorId: ObjectId('123'), createdAt: ISODate('2022-09-01T00:00:00Z') },
        { authorId: ObjectId('456'), createdAt: ISODate('2022-09-05T00:00:00Z') },
    ],

    'answers': [
        { authorId: ObjectId('123'), createdAt: ISODate('2022-09-05T08:00:00Z') },
        { authorId: ObjectId('456'), createdAt: ISODate('2022-09-01T08:00:00Z') },
    ],
    'comments': [
        { authorId: ObjectId('123'), createdAt: ISODate('2022-09-01T16:00:00Z') },
        { authorId: ObjectId('456'), createdAt: ISODate('2022-09-05T16:00:00Z') },
    ],
]
</code></pre>
<p>I want to get counts of documents from each collections with <code>created_at</code> between a given range and grouped by <code>authorId</code>.
A desired aggregation result may look like below. The <code>_id</code>s here are ObjectIds of documents in <code>users</code> collection.</p>
<pre><code>\\ match: { createdAt: { $gt: ISODate('2022-09-03T00:00:00Z) } }
[
    { _id: ObjectId('123'), questionCount: 0, answerCount: 1, commentCount: 0 }, 
    { _id: ObjectId('456'), questionCount: 1, answerCount: 0, commentCount: 1 }
]
</code></pre>
<p>Currently, I am running aggregation below for each collection, combining the results in the backend service. (I am using Spring Data MongoDB Reactive.) This seems very inefficient.</p>
<pre><code>db.collection.aggregate([
    { $match: { 
        created_at: { $gt: ISODate('2022-09-03T00:00:00Z') }
    }},
    { $group : {
        _id: '$authorId',
        count: {$sum: 1}
    }}
])
</code></pre>
<p>How can I get the desired result with one aggregation?</p>
<p>I thought <code>$unionWith</code> or <code>$lookup</code> may help but I'm stuck here.</p>

